import Footer from "./components/Footer.js";
import Header from "./components/Header.js";
//import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => {
  return (
    <div>
       <link href="https://unpkg.com/boxicons@2.0.9/css/boxicons.min.css" rel="stylesheet" />
      <Header />
      <Footer />
    </div>
  );
};

export default App;
